import React, { useState } from 'react';

function MyForm() {
  // Initialize the formData state with an object
  // containing a key 'name' set to an empty string
  const [formData, setFormData] = useState({ name: '' });

  // Handler for input changes
  const handleChange = (event) => {
    setFormData({
      ...formData,
      [event.target.name]: event.target.value
    });
  };

  // Handler for form submission
  const handleSubmit = (event) => {
    event.preventDefault();
    // Handle the form submission, e.g., send data to backend or display it
    console.log(formData); // For demonstration, logging the formData
  };

  return (
    <form onSubmit={handleSubmit}>
      <input
        type="text"
        name="name"
        value={formData.name}
        onChange={handleChange}
      />
      <button type="submit">Submit</button>
    </form>
  );
}

export default MyForm;
